(12, 12, 'A coming together of minds; a coming together in opinion or determination; the coming together in accord of two minds on a given proposition. In law, a concord of understanding and intention between two or more parties with respect to the effect upon their relative rights and duties, of certain past or future facts or performances. The consent of two or more persons concerning respecting the transmission of some property, right, or benefits, with the view of contracting an obligation, a mutual obligation. The union of two or more minds in a thing done or to be done; a mutual assent to do a thing.\n(Source: WESTS)', 'agreement', 0, 1, 0),
