(45, 45, 'Substances mixed in small quantities with another product to modify its chemical or physical state. Additives are used to make food look visually more attractive, in the case of colouring agents, as well as to preserve and extend the life of the product.\n(Source: WRIGHT)', 'additive', 0, 0, 0),
