(70, 70, '1) Establishment of a new forest by seeding or planting of nonforested land.\r\n2) The planting of trees on land which was previously used for other uses than forestry.\r\n3) The planting of trees in an area, or the management of an area to allow trees to regenerate or colonize naturally, in order to produce a forest.\r\n(Source: MGH /  WRIGHT /  ALL)', 'afforestation, afforestment, tree planting', 0, 0, 0),
(71, 71, 'The second largest of the continents, on the Mediterranean in the north, the Atlantic in the west, and the Red Sea, Gulf of Aden, and Indian Ocean in the east. The Sahara desert divides the continent unequally into North Africa and Africa south of Sahara. The largest lake is Lake Victoria and the chief rivers are the Nile, Niger, Congo, and Zambezi. The hottest continent, Africa has vast mineral resources, many of which are still undeveloped.\n(Source: CED /  AMHER)', 'Africa', 0, 0, 0),
(72, 72, 'An afterburner is a gadget fitted to the exhaust flues of furnaces and also to the exhaust systems of motor vehicles. They remove polluting gases and particles, which are the result of incompletely combusted fuel, by incineration and break down other chemical molecules associated with combustion into inert chemicals.\n(Source: WRIGHT)', 'afterburning, afterburner', 0, 0, 0),
(73, 73, 'The period of time that a person, animal or plant has lived or is expected to live.\n(Source: CED)', 'age', 0, 0, 0),
(74, 74, 'The coming together in accord of two minds on a given proposition. In law, a concord of understanding and intention between two or more parties with respect to the effect upon their relative rights and duties, of certain past or future facts or performances. The consent of two or more persons concerning respecting the transmission of some property, right, or benefits, with the view of contracting an obligation, a mutual obligation.\n(Source: WESTS)', 'agreement', 0, 0, 0),
(75, 75, 'An agreement, convention, or promise of two or more parties, by deed in writing, signed, and delivered, by which either of the parties pledges himself to the other that something is either done, or shall be done, or shall not be done, or stipulates for the truth of certain facts.\n(Source: WESTS)', 'agreement', 0, 0, 0),
(655430, 655430, '(Luscinia megarhynchos) A songbird.', 'nightingale', 0, 0, 0),
(1310800, 1310800, 'The junior partner in a paederastic relationship.', 'catamite', 0, 0, 0),
(1310837, 1310837, 'A large, cosmopolitan family of beetles. Most of them are shiny black or metallic and have elytras.', 'Ground beetles', 0, 0, 0),
(98, 98, 'The production of plants and animals useful to man, involving soil cultivation and the breeding and management of crops and livestock.\n(Source: MGH)', 'agriculture', 0, 0, 0),
(105, 105, 'The acquired immunodeficiency syndrome is caused by HIV-virus manifested by opportunistic infections and/or malignancies, and the mortality rate is very high. The syndrome results from a breakdown of the body^s disease-fighting mechanism that leaves it defenceless against infections, such as pulmonary tuberculosis, Pneumocystis pneumonia, certain blood infections, candidiasis, invasive cervical cancer, Kaposi^s sarcoma or any of over 20 other indicator diseases. No effective treatment is available. A striking feature of AIDS is the wide spectrum and frequency of infections with life-threatening pathogens seldom seen in normal hosts. The illness may begin with insidious signs and symptoms, and the process may be more diffuse than when the same conditions are seen in other immune-compromised patients. Four patterns of disease occur in AIDS patients. The pulmonary pattern, the central nervous system pattern, the gastrointestinal pattern, and the pattern of fever of unknown origin. Most patients who recover from a given opportunistic infection subsequently either have a relapse or develop a new type of infection. Many patients continue to have a wasting syndrome and experience such infections as oral thrush. Feelings of depression and isolation are common among AIDS patients and can be intensified if health care workers display fear of the syndrome.\n(Source: WPR)', 'acquired immunodeficiency syndrome, AIDS, acquired immune deficiency syndrome', 0, 0, 0),
(106, 106, 'A predominantly mechanical mixture of a variety of individual gases forming the earth^s enveloping atmosphere.\n(Source: MGH)', 'air', 0, 0, 0),
(107, 107, 'A system or process for controlling the temperature and sometimes the humidity and purity of the air in a house, etc.\r\n(Source: CED)', 'AC, air conditioning, air-conditioning', 0, 0, 0),
(108, 108, 'Any structure, machine, or contrivance, especially a vehicle, designed to be supported by the air, either by the dynamic action of the air upon the surfaces of the structure or object or by its own buoyancy.\n(Source: MGH)', 'aircraft', 0, 0, 0),
(113, 113, 'Presence in the atmosphere of large quantities of gases, solids and radiation produced by the burning of natural and artificial fuels, chemical and other industrial processes and nuclear explosions.\r\n(Source: GUNN)', 'air pollution', 0, 0, 0),
(114, 114, 'A landing and taking-off area for civil aircraft, usually with surfaced runways and aircraft maintenance and passenger facilities.\n(Source: CED)', 'airport', 0, 0, 0),
(524413, 524413, 'Perform an action, as in executing a program or a command.', 'launch, execute, run', 0, 0, 0),
(121, 121, 'Aircraft moving in flight or on airport runways.', 'air traffic', 0, 0, 0),
(124, 124, 'The use of aircraft, predominantly airplanes, to move passengers and cargo.\n(Source: MGH)', 'air transportation', 0, 0, 0),
(126, 126, 'The act of signalling an impending danger in order to call attention to some event or condition.\n(Source: CED /  AMHER)', 'alarm, alert, warning', 0, 0, 0),
(127, 127, 'A group of organic chemical compounds composed of carbon, hydrogen, and oxygen. The molecules in the series vary in chain length and are composed of a hydrocarbon plus a hydroxyl group. Alcohol includes methanol and ethanol.\r\n(Source: EIADOE)', 'alcohol', 0, 0, 0),
(128, 128, 'Simple, green, aquatic plants without stems, roots or leaves. They are among the microscopic organisms that form the start of the food chain. Algae are found floating in the sea and fresh water, but they also grow on the surface of damp walls, rocks, the bark of trees and on soil. They contain chlorophyll and other pigments that let them grow by photosynthesis. On land, algae can be useful in improving the fertility of soil by nitrogen fixation.\r\n(Source: WRIGHT)', 'alga', 0, 0, 0),
(1310828, 1310828, 'A beetle of the Carabidae family.', 'Ground beetle', 0, 0, 0),
(131, 131, 'Any substance composed of two or more unlike atoms held together by chemical bonds characterized by straight-chained, branched or cyclic properties.\n(Source: RHW)', 'alicyclic compound', 0, 0, 0),
(133, 133, 'Any organic compound of hydrogen and carbon characterized by a straight chain of the carbon atoms.\n(Source: MGH)', 'aliphatic compound', 0, 0, 0),
(137, 137, 'Paraffins. A homologous series of saturated hydrocarbons having the general formula CnH2n+2. Their systematic names end in -ane. They are chemically inert, stable, and flammable. The first four members of the series (methane, ethane, propane, butane) are gases at ordinary temperatures; the next eleven are liquids, and form the main constituents of paraffin oil; the higher members are solids. Paraffin waxs consists mainly of higher alkanes.\r\n(Source: UVAROV)', 'alkane, methane series, paraffin, alkane series', 0, 0, 0),
(139, 139, 'Any antigen, such as pollen, a drug, or food, that induces an allergic state in humans or animals.\n(Source: MGH)', 'allergen', 0, 0, 0),
(1573011, 1573011, 'A unit of information equal to 1000 gigabytes or 10^12 (1,000,000,000,000) bytes.', 'terabyte', 0, 0, 0),
