(359, 359, '1) Genetic diversity: the variation between individuals and between populations within a species; species diversity: the different types of plants, animals and other life forms within a region; community or ecosystem diversity: the variety of habitats found within an area (grassland, marsh, and woodland for instance.\n2) An umbrella term to describe collectively the variety and variability of nature. It encompasses three basic levels of organisation in living systems: the genetic, species, and ecosystem levels. Plant and animal species are the most commonly recognized units of biological diversity, thus public concern has been mainly devoted to conserving species diversity.\n(Source: WRES /  GILP96)', 'biodiversity', 0, 0, 0),
