(392, 392, 'That part of the Earth and atmosphere capable of supporting living organisms.\r\n(Source: LBC)', 'biosphere', 0, 0, 0),
(394, 394, 'Production, by synthesis or degradation, of a chemical compound by a living organism.\r\n(Source: MGH)', 'biosynthesis', 0, 0, 0),
(395, 395, 'A combination of biology and technology. It is used to describe developments in the application of biological organisms for commercial and scientific purposes. So "bio" stands for biology and the science of life, and "tech" stands for technology, or the tools and techniques that the biotechnologists have in their workbox. Those tools and techniques include microorganisms and a range of methods for manipulating them, such as genetic engineering.\r\n(Source: WRIGHT)', 'biotechnology', 0, 0, 0),
(1180057, 1180057, 'Inflammation of blood vessels.', 'vasculitis', 0, 0, 0),
(400, 400, 'Any of the warm-blooded vertebrates which make up the class Aves.\n(Source: MGH)', 'bird', 0, 0, 0),
(401, 401, 'Special area where birds are protected.\r\n(Source: PHC)', 'bird sanctuary', 0, 0, 0),
(402, 402, 'Any of various carnivorous bird of the orders Falconiformes and Strigiformes which feed on meat taken by hunting.\n(Source: MGH)', 'bird of prey', 0, 0, 0),
(404, 404, 'Limitation of the number of children born by preventing or reducing the frequency of impregnation.\r\n(Source: MGH)', 'birth control', 0, 0, 0),
(405, 405, 'A generic term applied to natural inflammable substances of variable colour, hardness, and volatility, composed principally of a mixture of hydrocarbons substantially free from oxygenated bodies. Bitumens are sometimes associated with mineral matter, the nonmineral constituents being fusible and largely soluble in carbon disulfide, yielding water-insoluble sulfonation products. Petroleum, asphalts, natural mineral waxes, and asphaltites are all considered bitumens.\r\n(Source: BJGEO)', 'bitumen', 0, 0, 0),
(406, 406, 'A natural black graphitelike material used as a fuel, formed from fossilized plants and consisting of amorphous carbon with various organic and some inorganic compounds.\n(Source: AMHER)', 'anthracite coal, black coal', 0, 0, 0),
(407, 407, 'A tall, cylindrical smelting furnace for reducing iron ore to pig iron; the blast of air blown through solid fuel increases the combustion rate.\n(Source: MGH)', 'blast furnace', 0, 0, 0),
(408, 408, '1) A chemical, such as an aromatic acyl peroxide or monoperoxiphthalic acid, used to bleach flour, fats, oils and other edibles. \n2) An oxidizing or reducing chemical such as sodium hypochlorite, sulfur dioxide, sodium acid sulfite, or hydrogen peroxide.\n(Source: MGH)', 'bleaching agent, bleach', 0, 0, 0),
(409, 409, 'Clay capable of chemically adsorbing oils, insecticides, alkaloids, vitamins, carbohydrates and other materials; it is used for refining and decolorizing mineral and vegetable oils.\n(Source: WRES)', 'bleaching clay', 0, 0, 0),
(411, 411, 'A fluid connective tissue consisting of the plasma and cells that circulate in the blood vessels.\n(Source: MGH)', 'blood', 0, 0, 0),
(412, 412, 'Microorganisms, formerly classified as algae but now regarded as bacteria, including nostoc, which contain a blue pigment in addition to chlorophyll.\r\n(Source: CED)', 'cyanobacteria, blue-green alga', 0, 0, 0),
(413, 413, 'To travel or go in a boat as a form of recreation.', 'boating', 0, 0, 0),
(1311114, 1311114, 'A dinosaur of the species Archaeopteryx lithographica having wings and feathers.', 'archeopteryx, archaeopteryx, archaiopteryx, archopteryx', 0, 0, 0),
(415, 415, 'An enclosed vessel in which water is heated and circulated, either as hot water or as steam, for heating or power.\r\n(Source: AMHER)', 'boiler', 0, 0, 0),
(416, 416, 'The temperature at which the transition from the liquid to the gaseous phase occurs in a pure substance at fixed pressure.\r\n(Source: MGH)', 'boiling point', 0, 0, 0),
(417, 417, 'A collection of leaves of paper, parchment or other material, usually bound or fastened together within covers, containing writing of any type or blank pages for future inscription.', 'book', 0, 0, 0),
(418, 418, 'The art or science of recording business accounts and transactions.\r\n(Source: WESTS)', 'bookkeeping', 0, 0, 0),
(419, 419, 'The dividing line or frontier between political or geographic regions.\n(Source: CED)', 'border', 0, 0, 0),
(420, 420, 'A very hard almost colourless crystalline metalloid element that in impure form exists as a brown amorphous powder. It occurs principally in borax and is used in hardening steel.\n(Source: CED)', 'boron', 0, 0, 0),
(421, 421, 'A place in which plants are grown, studied and exhibited.\n(Source: CED)', 'botanical garden', 0, 0, 0),
(422, 422, 'A branch of the biological sciences which embraces the study of plants and plant life.\r\n(Source: MGH)', 'phytology, plant biology, plant science, botany, plant sciences', 0, 0, 0),
(424, 424, 'The layer of fluid adjacent to a physical boundary in which the fluid motion is significantly affected by the boundary and has a mean velocity less than the free stream value.\n(Source: LBC)', 'boundary layer', 0, 0, 0),
(425, 425, 'Any animal belonging to the Bovidae family.\r\n(Source: CED)', 'bovid', 0, 0, 0),
(429, 429, 'The application of genetic principles to the improvement of farm animals and cultivated plants.\r\n(Source: MGH)', 'breeding', 0, 0, 0),
(1180095, 1180095, 'Inflammation of the walls of arteries.', 'arteritis', 0, 0, 0),
(432, 432, 'A building material usually made from clay, molded as a rectangular block, and baked or burned in a kiln.\r\n(Source: MGH)', 'brick', 0, 0, 0),
(433, 433, 'A structure that spans and provides a passage over a road, railway, river, or some other obstacle.\n(Source: CED)', 'bridge', 0, 0, 0),
(434, 434, 'A pungent dark red volatile liquid element of the halogen series that occurs in brine and is used in the production of chemicals.\r\n(Source: CED)', 'bromine', 0, 0, 0),
(435, 435, 'To incubate eggs or cover the young for warmth.\r\n(Source: MGH)', 'brooding', 0, 0, 0);
INSERT INTO `omega` (`id`, `real_id`, `definition`, `words`, `no_answer_vote`, `total_vote`, `answer_cid`) VALUES
(436, 436, 'A small stream or rivulet, commonly swiftly flowing in rugged terrain, of lesser length and volume than a creek; especially a stream that issues directly from the ground, as from a spring or seep, or that is produced by heavy rainfall or melting snow.\r\n(Source: BJGEO)', 'brook', 0, 0, 0),
(437, 437, 'Woody vegetation including shrubs and scrub trees of non-commercial height and form, often seen in the initial stages of succession following a disturbance. Brush often grows in very dense thickets that are impenetrable to wild animals and serve to suppress the growth of more desirable crop trees. However, brush can also serve an important function as desirable habitat for a range or bird, animal, and invertebrate species, and often provides a good source of browse and cover for larger wildlife. It adds structural diversity within the forest and is important in riparian zones. It is also termed scrub.\r\n(Source: DUNSTE)', 'brushwood', 0, 0, 0),
(438, 438, 'Any plant of the division Bryophyta, having stems and leaves but lacking true vascular tissue and roots and reproducing by spores: includes the mosses and liverworts.\r\n(Source: CED)', 'bryophyte', 0, 0, 0),
(440, 440, 'A balance sheet or statement of estimated receipts and expenditures. A plan for the coordination of resource and expenditures. The amount of money that is available for, required for, or assigned to a particular purpose.\r\n(Source: WESTS)', 'budget', 0, 0, 0),
(441, 441, 'Any of the suborder Heteroctera, having piercing and sucking mouthparts, specialized as a beak.\r\n(Source: CED)', 'bug, prnikas, hemipterous insect', 0, 0, 0),
(442, 442, 'Something built with a roof and walls, such as a house or factory.\n(Source: CED)', 'building', 0, 0, 0),
(447, 447, 'Any material used in construction, such as steel, concrete, brick, masonry, glass, wood, etc.\n(Source: HARRIS)', 'building material', 0, 0, 0),
(917937, 917937, 'A piece of ridiculous pretence which is so obvious that it does not deceive anyone.', 'charade', 0, 0, 0),
(451, 451, 'A piece of land on which a house or other building is being built.\r\n(Source: CAMB)', 'building site', 0, 0, 0),
(453, 453, '<Definition needed.>', 'building technology, architectural engineering', 0, 0, 0),
(393668, 393668, 'A small, round, smooth-skinned edible fruit, usually purple, red, or green, that grows in bunches on certain vines.', 'grape', 0, 0, 0),
(461, 461, 'A large, long-bodied motor vehicle equipped with seating for passengers, usually operating as part of a scheduled service.', 'bus, coach, coach', 0, 0, 0),
(462, 462, 'The activity, position or site associated with commerce or the earning of a livelihood.\n(Source: West^s / RHW)', 'business', 0, 0, 0),
(463, 463, 'Any diurnal insect of the order Lepidoptera that has a slender body with clubbed antennae and typically rests with the wings (which are often brightly coloured) closed over the back.\n(Source: CED)', 'butterfly, lepidopteran', 0, 0, 0),
(465, 465, 'Incidental taking of non-commercial species in drift nets, trawling operations and long line fishing; it is responsible for the death of large marine animals and one factor in the threatened extinction of some species.\r\n(Source: WPR)', 'by-catch, bycatch', 0, 0, 0),
(466, 466, 'A product from a manufacturing process that is not considered the principal material.\r\n(Source: MGH)', 'by-product', 0, 0, 0),
(467, 467, 'Strands of insulated electrical conductors laid together, usually around a central core, and wrapped in a heavy insulation.\r\n(Source: MGH)', 'cable', 0, 0, 0),
(468, 468, 'One of the toxic heavy metal which has caused deaths and permanent illnesses in a series of major pollution incidents around the world. Cadmium has no useful biological purpose. However, it has wide industrial applications. It has been used for decades in metal plating to prevent corrosion, in rechargeable batteries and as a pigment in certain plastics and paints. Special care is taken in the industrial smelting of ores and subsequent handling of cadmium, because occupational exposure is known to have caused heart, chest and kidney disorders. Environmental health problems have come from exposure to various sources of pollution.\r\n(Source: WRIGHT)', 'cadmium', 0, 0, 0),
(470, 470, 'A soft silvery-white and highly reactive metal belonging to the alkali group of metals. It is a radiation hazard, because it can occur in two radioactive forms. Caesium-134 is produced in nuclear reactors, not directly by fission, but by the reaction. It emits beta- and gamma-radiation and has a half-life of 2.06 years. Caesium-137 is a fission product of uranium and occurs in the fallout from nuclear weapons. It emits beta- and gamma-rays and has a half-life of 30 years. Caesium-137 was the principal product released into the atmosphere, and hence the food chain, from atmospheric testing of nuclear weapons and from the Windscale fire and Chernobyl nuclear accidents. After the Chernobyl accident, which spread a radiation cloud across Europe, the European Commission proposed new and more restrictive limits on levels of caesium in food and drinking water.\r\n(Source: WRIGHT)', 'caesium', 0, 0, 0),
(471, 471, 'A malleable silvery-white metallic element of the alkaline hearth group; the fifth most abundant element in the earth crust, occurring especially as forms of calcium carbonate. It is an essential constituent of bones and teeth and is used as a deoxidizer in steel.\r\n(Source: CED)', 'calcium', 0, 0, 0),
(474, 474, 'To mark the scale of a measuring instrument so that readings can be made in appropriate units.\r\n(Source: CED)', 'calibration', 0, 0, 0),
(917973, 917973, '', 'nectarine', 0, 0, 0),
(476, 476, 'Guarded area equipped with sanitary facilities where holiday-makers may pitch a tent and camp by paying a daily rate.\n(Source: ZINZAN)', 'camping, campsite, camping ground', 0, 0, 0),
(477, 477, 'A piece of land where people on holiday can stay in tents, usually with toilets and places for washing.\n(Source: CAMB)', 'camping site', 0, 0, 0),
(478, 478, 'An artificial open waterway used for transportation, waterpower, or irrigation.\n(Source: MGH)', 'canal', 0, 0, 0),
(479, 479, 'Any malignant cellular tumour including carcinoma and sarcoma. It encompasses a group of neoplastic diseases in which there is a transformation of normal body cells into malignant ones, probably involving some change in the genetic material of the cells, possibly as a result of faulty repair of damage to the cell caused by carcinogenic agents or ionizing radiation.\n(Source: KOREN)', 'cancer', 0, 0, 0),
(481, 481, 'Carnivorous mammal in the superfamily Canoidea, including dogs and their allies.\r\n(Source: MGH)', 'canid, canids', 0, 0, 0),
(482, 482, 'A four-wheeled motor vehicle used for land transport, usually propelled by a gasoline or diesel internal combustion engine.\n(Source: RHW)', 'car, automobile', 0, 0, 0),
(918000, 918000, 'An apparatus that charges storage batteries.', 'charger', 0, 0, 0),
(483, 483, 'Any of the group of organic compounds composed of carbon, hydrogen and oxygen, including sugars, starches and celluloses.\r\n(Source: MGH)', 'carbohydrate', 0, 0, 0),
(484, 484, 'A nonmetallic element existing in the three crystalline forms: graphite, diamond and buckminsterfullerene: occurring in carbon dioxide, coal, oil and all organic compounds.\n(Source: CED)', 'carbon', 0, 0, 0),
(485, 485, 'A salt or ester of carbonic acid.\r\n(Source: CED)', 'carbonate', 0, 0, 0),
(486, 486, 'The cycle of carbon in the biosphere, in which plants convert carbon dioxide to organic compounds that are consumed by plants and animals, and the carbon is returned to the biosphere in inorganic form by processes of respiration and decay.\r\n(Source: MGH)', 'carbon cycle', 0, 0, 0),
(487, 487, 'A colourless gas with a faint tingling smell and taste. Atmospheric carbon dioxide is the source of carbon for plants. As carbon dioxide is heavier than air and does not support combustion, it is used in fire extinguishers. It is a normal constituent of the atmosphere, relatively innocuous in itself but playing an important role in the greenhouse effect. It is produced during the combustion of fossil fuels when the carbon content of the fuels reacts with the oxygen during combustion. It is also produced when living organisms respire. It is essential for plant nutrition and in the ocean phytoplankton is capable of absorbing and releasing large quantities of the gas.\r\n(Source: UVAROV /  GILP96)', 'carbon dioxide, carbonic acid gas', 0, 0, 0),
(489, 489, 'Colorless, odourless, tasteless, non-corrosive, highly poisonous gas of about the same density as that of air. Very flammable, burning in air with bright blue flame. Although each molecule of CO has one carbon atom and one oxygen atom, it has a shape similar to that of an oxygen molecule (two atoms of oxygen), which is important with regard to it^s lethality.\r\n(Source: PHYMAC)', 'carbon monoxide', 0, 0, 0),
(493, 493, 'A substance that causes cancer in humans and animals.\n(Source: WRIGHT)', 'carcinogen', 0, 0, 0),
(1180159, 1180159, 'Inflammation of the spinal cord.', 'myelitis', 0, 0, 0),
(494, 494, 'The study of the heart.\n(Source: MGH)', 'cardiology', 0, 0, 0),
(495, 495, '<Definition needed.>', 'cardiovascular disease', 0, 0, 0),
(496, 496, 'A geographical region bordered on the south by South America and Panama, and on the west by Central America, and consisting of the West Indian, and nearby, islands and the Caribbean Sea, a part of the western Atlantic Ocean.\n(Source: RHW)', 'Caribbean, Caribbean Area', 0, 0, 0),
(497, 497, 'An animal that eats meat.\n(Source: CAMB)', 'carnivore', 0, 0, 0),
(500, 500, 'The making of maps and charts for the purpose of visualizing spatial distributions over various areas of the earth.\r\n(Source: MGH)', 'cartography', 0, 0, 0),
(502, 502, 'Crops that are grown for sale in the town markets or for export. They include coffee, cocoa, sugar, vegetables, peanuts and non-foods, like tobacco and cotton. Huge areas of countries in the developing world have been turned over to cash crops. Those countries with no mineral or oil resources depend on cash crops for foreign money, so that they can import materials do develop roads, for construction, or to buy Western consumer goods and, indeed, food. However, critics argue that cash crops are planted on land that would otherwise be used to grow food for the local community and say this is a cause of world famine. Cash crops, such as peanuts, can ruin the land if it is not left fallow after six years of harvests. Moreover, if the best agricultural land is used for cash crops, local farmers are forced to use marginal land to grow food for local consumption, and this has a further dramatic effect on the environment.\r\n(Source: WRIGHT)', 'cash crop', 0, 0, 0),
(503, 503, 'A phenomenon in which a relatively small amount of substance augments the rate of a chemical reaction without itself being consumed.\r\n(Source: MGH)', 'catalysis', 0, 0, 0),
(504, 504, 'A substance whose presence alters the rate at which a chemical reaction proceeds, but whose own composition remains unchanged by the reaction. Catalysts are usually employed to accelerate reactions(positive catalyst), but retarding (negative) catalysts are also used.\r\n(Source: ALL)', 'catalyst', 0, 0, 0),
(505, 505, 'Catalytic converters are designed to clean up the exhaust fumes from petrol-driven vehicles, which are otherwise the major threat to air quality standards in congested urban streets and on motorways. Converters remove carbon monoxide, the unburned hydrocarbons and the oxides of nitrogen. These compounds are damaging to human health and the environment in a variety of ways. The converter is attached to the vehicle^ s exhaust near the engine. Exhaust gases pass through the cellular ceramic substrate, a honeycomb-like filter. While compact, the intricate honeycomb structure provides a surface area of 23.000 square metres. This is coated with a thin layer of platinum, palladium and rhodium metals, which act as catalysts that simulate a reaction to changes in the chemical composition of the gases. Platinum and palladium convert hydrocarbons and carbon monoxide into carbon dioxide and water vapour. Rhodium changes nitrogen oxides and hydrocarbons into nitrogen and water, which are harmless.\n(Source: WRIGHT)', 'catalytic converter', 0, 0, 0),
(506, 506, 'A sudden, widespread disaster or calamity that greatly exceeds the resources of an area or region.', 'catastrophe', 0, 0, 0),
(507, 507, '1) An area from which surface runoff is carried away by a single drainage system.\r\n2) The area of land bounded by watersheds draining into a river, basin or reservoir.\r\n(Source: LANDY /  CED)', 'catchment area', 0, 0, 0),
(510, 510, 'A positively charged atom or group of atoms, or a radical which moves to the negative pole (cathode) during electrolysis.\r\n(Source: MGH)', 'cation', 0, 0, 0),
(511, 511, 'Domesticated bovine animals, including cows, steers and bulls, raised and bred on a ranch or farm.\n(Source: MGH)', 'cattle', 0, 0, 0),
(513, 513, '1) An underground hollow with access from the ground surface or from the sea, often found in limestone areas and on rocky coastlines.\r\n2) A natural cavity, chamber or recess which leads beneath the surface of the earth, generally in a horizontal or obliquely inclined direction. It may be in the form of a passage or a gallery, its shape depending in part on the joint pattern or structure of the rock and partly on the type of process involved in its excavation. Thus, caves worn by subterranean rivers may be different in character from, and of considerably greater extent than, a sea-cave eroded by marine waves.\r\n3) A natural underground open space, generally with a connection to the surface and large enough for a person to enter. The most common type of cave is formed in a limestone by dissolution.\r\n(Source: CED /  WHIT /  BJGEO)', 'cave', 0, 0, 0),
(514, 514, 'The microscopic functional and structural unit of all living organisms, consisting of a nucleus, cytoplasm, and a limiting membrane.', 'cell', 0, 0, 0),
(515, 515, 'The basic building block of a battery. It is an electrochemical device consisting of an anode and a cathode in a common electrolyte kept apart with a separator. This assembly may be used in its own container as a single cell battery or be combined and interconnected with other cells in a container to form a multicelled battery.', 'energy cell, cell, , Galvanic cell, electrochemical cell', 0, 0, 0),
(516, 516, 'The main polysaccharide in living plants, forming the skeletal structure of the plant cell wall; a polymer of beta-D-glucose linked together with the elimination of water to form chains of 2000-4000 units.\r\n(Source: MGH)', 'cellulose', 0, 0, 0),
(518, 518, 'A dry powder made from silica, alumina, lime, iron oxide, and magnesia which hardens when mixed with water; used as an ingredient in concrete.\n(Source: MGH)', 'cement', 0, 0, 0),
(918026, 918026, 'Personal magnetism or charm.', 'charisma', 0, 0, 0),
(521, 521, 'A geographic region of the African continent close to the equator that includes Cameroon, Chad, Equatorial Guinea, Gabon, the Central African Republic and the Democratic Republic of Congo.\n(Source: OMD / CIA)', 'Central Africa', 0, 0, 0),
(522, 522, 'A narrow continental region of the Western hemisphere, existing as a bridge between North and South America, often considered to be the southern portion of North America, and including countries such as Guatemala, Belize, El Salvador, Honduras, Nicaragua, Costa Rica and Panama.\n(Source: RHW)', 'Central America', 0, 0, 0),
(524803, 524803, 'The genetic composition, alleles, of an individual in total or at a specific locus.', 'genotype', 0, 0, 0),
(525, 525, '<Definition needed.>', 'centralisation', 0, 0, 0),
(526, 526, 'Separation of particles from a suspension in a centrifuge: balanced tubes containing the suspension are attached to the opposite ends of arms rotating rapidly about a central point; the suspended particles are forced outwards, and collect at the bottoms of the tubes.\n(Source: UVAROV)', 'centrifugation', 0, 0, 0),
(527, 527, 'Exclusively marine animals constituting the most advanced class of the Mollusca, including squid, octopuses, and Nautilus.\r\n(Source: MGH)', 'cephalopod', 0, 0, 0),
(528, 528, 'The art and techniques of producing articles of clay, porcelain, etc.\r\n(Source: CED)', 'ceramics', 0, 0, 0),
(1311237, 1311237, 'The wife of a count or earl, or the female ruler of a county.', 'countess', 0, 0, 0),
(530, 530, 'Aquatic mammals, including the whales, dolphins, and porpoises.\r\n(Source: MGH)', 'cetacean', 0, 0, 0),
(534, 534, 'Any system of distribution canals or conduits for water, gas, electricity, or steam.\r\n(Source: MGH)', 'channelling', 0, 0, 0),
(535, 535, 'A porous solid product containing 85-98% carbon and produced by heating carbonaceous materials such as cellulose, wood or peat at 500-600 C in the absence of air.\r\n(Source: MGH)', 'charcoal', 0, 0, 0),
(538, 538, 'A subphylum of the phylum Artrophoda; chelicerae are characteristically modified as pincers.\r\n(Source: MGH)', 'chelicerate', 0, 0, 0),
(539, 539, 'The complex of operations aiming to determine the kinds of constituents of a given substance.\n(Source: ZINZAN)', 'chemical analysis', 0, 0, 0),
(542, 542, 'The branch of engineering concerned with industrial manufacture of chemical products. It is a discipline in which the principles of mathematical, physical and natural sciences are used to solve problems in applied chemistry. Chemical engineers design, develop, and optimise processes and plants, operate them, manage personnel and capital, and conduct research necessary for new developments. Through their efforts, new petroleum products, plastics, agricultural chemicals, house-hold products, pharmaceuticals, electronic and advanced materials, photographic materials, chemical and biological compounds, various food and other products evolve.\r\n(Source: USTa)', 'chemical engineering', 0, 0, 0),
(545, 545, 'Industry related with the production of chemical compounds. The chemical processing industry has a variety of special pollution problems due to the vast number of products manufactured. The treatment processes combine processing, concentration, separation, extraction, by-product recovery, destruction, and reduction in concentration. The wastes may originate from solvent extraction, acid and caustic wastes, overflows, spills, mechanical loss, etc.\n(Source: PZ)', 'chemical industry', 0, 0, 0),
(549, 549, 'Plants where basic raw materials are chemically converted into a variety of products.\n(Source: MGH)', 'chemical plant', 0, 0, 0),
(553, 553, 'The particular method of manufacturing or making a chemical usually involving a number of steps or operations.\n(Source: KOREN)', 'chemical process', 0, 0, 0),
(918055, 918055, 'Relating to or characterized by charity.', 'charitable', 0, 0, 0),
(554, 554, 'Properties of a substance depending on the arrangement of the atoms in the molecule, e.g. bio-availability, degradability, persistence, etc.\n(Source: RRDA)', 'chemical property', 0, 0, 0),
(555, 555, 'A change in which a substance is transformed into one or more new substances.\n(Source: MGH)', 'chemical reaction', 0, 0, 0),
(557, 557, 'Any substance used in or resulting from a reaction involving changes to atoms or molecules.\n(Source: CED)', 'chemical', 0, 0, 0),
(918078, 918078, 'A person fraudulently claiming knowledge and skills not possessed.', 'charlatan', 0, 0, 0),
(565, 565, 'Chemical agents of warfare include all gaseous, liquid or solid chemical substances which might be employed because of their direct toxic effects on man and animals. Chemical weapons also include the chemical^s precursors, the munitions and devices designed to deliver them, and any equipment specifically designed for their use in warfare. Nerve agents (chemicals of the same family as organophosphorous insecticides) are the most lethal of the classical chemical warfare agents, killing by poisoning the nervous system and disrupting bodily functions. Other chemical weapons include blister agents, vesicants, choking agents, etc.\n(Source: WPR)', 'chemical weapon', 0, 0, 0),
(524861, 524861, 'A British overseas territory located near the southernmost tip of the Iberian Peninsula', 'Gibraltar', 0, 0, 0),
(566, 566, 'The process of chemical adsorption.\r\n(Source: MGH)', 'chemisorption', 0, 0, 0),
(567, 567, 'The scientific study of the properties, composition, and structure of matter, the changes in structure and composition of matter, and accompanying energy changes.\n(Source: MGH)', 'chemistry', 0, 0, 0),
(568, 568, 'A person below the age of puberty.\n(Source: ISEP)', 'child', 0, 0, 0),
(569, 569, 'A vertical structure of brick, masonry, or steel that carries smoke or steam away from a fire, engine, etc.\r\n(Source: CED)', 'chimney', 0, 0, 0),
(571, 571, 'Order of placental mammals comprising the bats having the front limbs modified as wings.\r\n(Source: CED)', 'chiropteran', 0, 0, 0),
(572, 572, 'A compound which is derived from hydrochloric acid and contains the chlorine atom in the -1 oxidation state.\r\n(Source: MGH)', 'chloride', 0, 0, 0),
(524852, 524852, 'Non-Jewish.', 'gentile', 0, 0, 0),
(574, 574, 'The application of chlorine to water, sewage or industrial wastes for disinfection or other biological or chemical purposes.\r\n(Source: ALL)', 'chlorination', 0, 0, 0),
(575, 575, 'A very reactive and highly toxic green, gaseous element, belonging to the halogen family of substances. It is one of the most widespread elements, as it occurs naturally in sea-water, salt lakes and underground deposits, but usually occurs in a safe form as common salt (NaCl). Commercially it is used in large quantities by the chemical industry both as an element to produce chlorinated organic solvents, like polychlorinated biphenyls (PCBs), and for the manufacture of polyvinyl chloride plastics, thermoplastic and hypochlorite bleaches. Chlorine was the basis for the organochlorine pesticides, like DDT and other agricultural chemicals that have killed wildlife. The reactivity of chlorine has proved disastrous for the ozone layer and has been the cause of the creation of the ozone hole, which was first detected in the Southern Hemisphere over Antarctica and then over the Northern Hemisphere.\n(Source: WRIGHT)', 'chlorine', 0, 0, 0),
(577, 577, 'Gases formed of chlorine, fluorine, and carbon whose molecules normally do not react with other substances; they are therefore used as spray can propellants because they do not alter the material being sprayed.\n(Source: LANDY)', 'CFC, chlorofluorocarbon', 0, 0, 0),
(581, 581, 'A green pigment, present in algae and higher plants, that absorbs light energy and thus plays a vital role in photosynthesis. Except in Cyanophyta (blue-green algae), chlorophyll is confined to chloroplasts. There are several types of chlorophyll, but all contain magnesium and iron. Some plants (e.g., brown algae, red algae, copper beech trees) contain additional pigments that masks the green of their chlorophyll.\n(Source: ALL)', 'chlorophyll', 0, 0, 0),
(918091, 918091, 'One who charms, or has power to charm', 'charmer', 0, 0, 0),
(582, 582, 'A disease condition of green plants seen as yellowing of green parts of the plants.\r\n(Source: MGH)', 'chlorosis', 0, 0, 0),
(584, 584, 'A method of separating and analyzing mixtures of chemical substances by selective adsorption in a column of powder or on a strip of paper.\r\n(Source: MGH)', 'chromatography', 0, 0, 0),
(585, 585, 'A hard grey metallic element that takes a high polish, occurring principally in chromite: used in steel alloys and electroplating to increase hardness and corrosion-resistance.\r\n(Source: CED)', 'chromium', 0, 0, 0),
(586, 586, 'The golden-brown and orange-yellow algae; a diverse group of microscopically small algae which inhabit fresh and salt water, many being planktonic. They contain carotenoid pigments and may be unicellular, colonial, filamentous or amoeboid.\r\n(Source: ALL)', 'chrysophyta', 0, 0, 0),
(587, 587, 'A building for religious activities.\n(Source: CAMB)', 'church, church building', 0, 0, 0),
(589, 589, 'Term used generically today to denote any urban form but applied particularly to large urban settlements. There are, however, no agreed definitions to separate a city from the large metropolis or the smaller town.\n(Source: GOOD)', 'city', 0, 0, 0),
(590, 590, 'The central part of a city.', 'city center, city centre', 0, 0, 0),
(1311323, 1311323, 'The ability to see clearly in low light conditions.', 'night vision', 0, 0, 0),
(593, 593, 'The planning, design, construction, and maintenance of fixed structures and ground facilities for industry, transportation, use and control of water or occupancy.\r\n(Source: MGH)', 'civil engineering', 0, 0, 0),
(595, 595, 'Law inspired by old Roman Law, the primary feature of which was that laws were written into a collection; codified, and not determined, as is common law, by judges. The principle of civil law is to provide all citizens with an accessible and written collection of the laws which apply to them and which judges must follow.\r\n(Source: DUHA)', 'civil law', 0, 0, 0),
(1573452, 1573452, 'Selective allocation of mental processing resources to one aspect of the environment.', 'attention', 0, 0, 0),
(598, 598, 'An arrangement or organization of persons, items or data elements into groups by reason of common attributes, characteristics, qualities or traits.\r\n(Source: RHW)', 'classification', 0, 0, 0),
(599, 599, 'A loose, earthy, extremely fine-grained, natural sediment or soft rock composed primarily of clay-size or colloidal particles and characterized by high plasticity and by a considerable content of clay mineral and subordinate amounts of finely divided quartz, decomposed feldspar, carbonates, ferruginous matter, and other impurities; it forms a plastic, moldable mass when finely ground and mixed with water, retains its shape on drying, and becomes firm, rocklike and permanently hard on heating or firing.\r\n(Source: BJGEO)', 'clay', 0, 0, 0),
(1573455, 1573455, 'An action or remark expressing concern for or interest in someone or something.', 'attention', 0, 0, 0),
(1311300, 1311300, 'The inability to see in bright light.', 'hemeralopia, day blindness', 0, 0, 0),
(1573443, 1573443, 'Money that a person or an institution obtains.', 'income', 0, 0, 0),
(604, 604, 'The average weather condition in a region of the world. Many aspects of the Earth^s geography affect the climate. Equatorial, or low, latitudes are hotter than the polar latitudes because of the angle at which the rays of sunlight arrive at the Earth^s surface. The difference in temperature at the equator and at the poles has an influence on the global circulation of huge masses of air. Cool air at the poles sinks and spreads along the surface of the Earth towards the equator. Cool air forces its way under the lower density warmer air in the lower regions, pushing the lighter air up and toward the poles, where it will cool and descend.\r\n(Source: WRIGHT)', 'climate', 0, 0, 0),
(393831, 393831, 'A fruit produced by the pear tree.', 'pear', 0, 0, 0),
(610, 610, 'The long-term fluctuations in temperature, precipitation, wind, and all other aspects of the Earth^s climate. External processes, such as solar-irradiance variations, variations of the Earth^s orbital parameters (eccentricity, precession, and inclination), lithosphere motions, and volcanic activity, are factors in climatic variation. Internal variations of the climate system, e.g., changes in the abundance of greenhouse gases, also may produce fluctuations of sufficient magnitude and variability to explain observed climate change through the feedback processes interrelating the components of the climate system.\n(Source: GSFC)', 'climatic change, climate change', 0, 0, 0),
(1573498, 1573498, 'A single item belonging to a class of similar items.', 'piece', 0, 0, 0),
(613, 613, 'A belt of the earth^s surface within which the climate is generally homogeneous in some respect; an elemental region of a simple climatic classification.\n(Source: MGH)', 'climatic zone', 0, 0, 0),
(614, 614, 'That branch of meteorology concerned with the mean physical state of the atmosphere together with its statistical variations in both space and time as reflected in the weather behaviour over a period of many years.\r\n(Source: MGH)', 'climatology', 0, 0, 0),
(615, 615, 'A botanical term referring to the terminal community said to be achieved when a sere (a sequential development of a plant community or group of plant communities on the same site over a period of time) achieves dynamic equilibrium with its environment and in particular with its prevailing climate. Each of the world^s major vegetation climaxes is equivalent to a biome. Many botanists believe that climate is the master factor in a plant environment and that even if several types of plant succession occur in an area they will all tend to converge towards a climax form of vegetation.\r\n(Source: WHIT)', 'climax', 0, 0, 0),
(618, 618, 'The production of genetically identical individuals from a single parent. Cloning plants usually involves plant cell culture. Cloning animals is more difficult and relays on some manipulation of their normal reproductive cycle. A clone is a group of organisms of identical genetic constitution, unless mutation occurs, produced from a single individual by asexual reproduction, parthenogenesis or apomixis.\r\n(Source: BIOTAZ)', 'cloning', 0, 0, 0),
(621, 621, 'Clothes considered as a group.\r\n(Source: AMHER)', 'clothing, garments, apparel', 0, 0, 0),
(623, 623, 'Suspensions of minute water droplets or ice crystals produced by the condensation of water vapour.\n(Source: ZINZAN)', 'cloud', 0, 0, 0),
(918113, 918113, 'A place for the bones thrown up when digging new graves in old burial grounds.', 'charnel house, charnel', 0, 0, 0),
(624, 624, 'A separation or precipitation from a dispersed state of suspensoid particles resulting from their growth; may result from prolonged heating, addition of an electrolyte, or from a condensation reaction between solute and solvent.\r\n(Source: MGH)', 'coagulation', 0, 0, 0),
(625, 625, 'The natural, rocklike, brown to black derivative of forest-type plant material, usually accumulated in peat beds and progressively compressed and indurated until it is finally altered in to graphite-like material.\r\n(Source: MGH)', 'coal', 0, 0, 0),
(1573484, 1573484, 'A way of looking at something.', 'angle', 0, 0, 0),
(633, 633, 'A line or zone where the land meets the sea or some other large expanse of water.\n(Source: CED)', 'coast, seaside', 0, 0, 0),
(918135, 918135, 'A green or yellow liqueur made from herbs and flowers.', 'chartreuse', 0, 0, 0),
(1311337, 1311337, 'A tree belonging to the Arecaceae family which is used to produce palm oil.', 'oil palm', 0, 0, 0),
(643, 643, 'A maritime force which aids shipping, saves lives at sea, prevents smuggling, etc. It also responds to emergencies involving oil spills and other discharges at sea and takes the lead in enforcing the law, including assessing penalties for environmental violations.\n(Source: CED /  PATHUL)', 'coastguard', 0, 0, 0),
(644, 644, 'A material applied onto or impregnated into a substrate for protective, decorative, or functional purposes. Such materials include, but are not limited to, paints, varnishes, sealers, adhesives, thinners, diluents, and inks.\n(Source: LEE)', 'coating', 0, 0, 0),
(645, 645, 'A metallic element used chiefly in alloys.\r\n(Source: MGH)', 'cobalt', 0, 0, 0),
(646, 646, 'The most primitive of the living winged insects. It is thought they have been unchanged for more than 300 million years, and are among the oldest fossil insects. Cockroaches are usually found in tropical climates, but a few species, out of the total 3.500 known species, have become pests. They are common household pests in many countries, imported by ship and carried home in grocery bags. Cockroaches eat plant and animal products, including food, paper, clothing and soiled hospital waste, fouling everything they touch with their droppings and unpleasant odour, to which many people are allergic. They are a major health hazard and carry harmful bacteria, protozoan parasites and faunal pathogens, including those that cause typhoid, leprosy and salmonella. Conventional insecticides make little or no impact on the cockroaches population.\r\n(Source: WRIGHT /  WPR)', 'cockroach', 0, 0, 0),
(918156, 918156, 'Pure in thought and act.', 'chaste', 0, 0, 0),
(649, 649, 'A systematic collection, compendium or revision of laws, rules, or regulations. A private or official compilation of all permanent laws in force consolidated and classified according to subject matter. Many states have published official codes of all laws in force, including the common law and statutes as judicially interpreted, which have been compiled by code commissions and enacted by the legislatures.\n(Source: WESTS)', 'code', 0, 0, 0),
(1049241, 1049241, 'Made of alabaster.', 'alabaster', 0, 0, 0),
(650, 650, 'Animals that have a single body cavity (the coelenteron). The name was formerly given to a phylum comprising the Cnidaria and Ctenophora, but these are now regarded as phyla in their own right, and the name Coelenterata has fallen from use, although it is sometimes used as a synonym for Cnidaria.\r\n(Source: ALL)', 'coelenterate', 0, 0, 0),
(1311390, 1311390, 'A tropical tree with feathery leaves which bears coconuts.', 'coconut, cocnut, coconut palm', 0, 0, 0),
(653, 653, 'A coherent, cellular, solid residue remaining from the dry distillation of a coking coal or of pitch, petroleum, petroleum residue, or other carbonaceous materials; contains carbon as its principal constituent.\r\n(Source: MGH)', 'coke', 0, 0, 0),
(654, 654, 'A condition of low temperature.', 'cold', 0, 0, 0),
(1049247, 1049247, 'Resembling alabaster.', 'alabaster', 0, 0, 0),
(657, 657, 'An intimate mixture of two substances, one of which, called the dispersed phase, is uniformly distributed in a finely divided state through the second substance, called the dispersion medium.\r\n(Source: MGH)', 'colloid', 0, 0, 0),
(1573514, 1573514, 'An artillery gun.', 'piece', 0, 0, 0),
(659, 659, 'The successful invasion of a new habitat by a species.\n(Source: LBC)', 'colonisation', 0, 0, 0),
(661, 661, 'An attribute of things that results from the light they reflect, transmit, or emit in so far as this light causes a visual sensation that depends on its wavelengths.\n(Source: CED)', 'colour, colo(u)r, color, colour', 0, 0, 0),
(1573517, 1573517, 'A toupee or wig, usually when worn by a man.', 'piece, hairpiece', 0, 0, 0),
(1573520, 1573520, 'A slice or other quantity of bread, eaten on its own; a sandwich or light snack.', 'piece', 0, 0, 0),
(665, 665, 'The property of a substance of being capable of igniting and burning.\r\n(Source: CEDa)', 'combustibility', 0, 0, 0),
(1573505, 1573505, 'One of the figures used in playing chess.', 'piece', 0, 0, 0),
(524947, 524947, 'Inclined to engage in lawsuits.', 'litigious', 0, 0, 0),
(1573508, 1573508, 'An amount of gold, silver, etc. made into a coin.', 'piece', 0, 0, 0),
(669, 669, 'Holding or displaying for sale, offering for sale, selling, delivering or placing on the market in any other form.\r\n(Source: ECHO1)', 'commercialisation', 0, 0, 0),
(670, 670, 'The whole body of substantive jurisprudence applicable to the rights, intercourse and relations of persons engaged in commerce, trade or mercantile pursuits.\r\n(Source: BLACK)', 'business law, commercial law', 0, 0, 0),
(1573511, 1573511, 'An artistic creation, such as a painting, sculpture, musical composition, literary work, etc.', 'piece', 0, 0, 0),
(1049266, 1049266, 'Alcoholic beverage that is produced by distillation as opposed to ethanol fermentation.', 'brandy', 0, 0, 0),
(677, 677, 'The concept, science, technique and process of transmitting, receiving or otherwise exchanging information and data.', 'communications', 0, 0, 0),
(1573566, 1573566, 'A length of time.', 'period', 0, 0, 0),
(682, 682, 'Traffic caused by people travelling regularly over some distance, as between a suburb and a city and back, between their place of residence and their place of work.', 'commuter traffic', 0, 0, 0),
(918184, 918184, 'A long sleeveless vestment worn by a priest when celebrating Mass', 'chasuble', 0, 0, 0),
(683, 683, '<Definition needed.>', 'commuting', 0, 0, 0),
(684, 684, 'Reduction of the bulk of solid waste by rolling and tamping.\r\n(Source: LEE)', 'compaction', 0, 0, 0),
(524966, 524966, 'Of or belonging to or characteristic of a particular locality or neighborhood.', 'local', 0, 0, 0),
(688, 688, 'The placing together or juxtaposing of two or more items to ascertain, bring into relief, or establish their similarities and dissimilarities.\r\n(Source: WEBSTE)', 'comparison', 0, 0, 0),
(689, 689, 'Equivalent in money for a loss sustained; equivalent given for property taken or for an injury done to another; recompense or reward for some loss, injury or service.\r\n(Source: WESTS)', 'compensation', 0, 0, 0),
(918205, 918205, 'An informal conversation.', 'chat, babble', 0, 0, 0),
(692, 692, 'The simultaneous demand by two or more organisms or species for an essential common resource that is actually or potentially in limited supply.\n(Source: LBC)', 'competition', 0, 0, 0),
(694, 694, 'The ability of a firm to strive in the market with rivals in the production and sale of commodities or services and, analogously, the ability of a country to maintain a relatively high standard of living for its citizens through trade in international markets.\r\n(Source: http://www.indiana.edu/~ipe/glossry.html / OED)', 'competitiveness', 0, 0, 0),
(698, 698, 'A mixture of decaying organic matter used to fertilize and condition the soil.\r\n(Source: MGH)', 'compost', 0, 0, 0),
(700, 700, 'The natural biological decomposition of organic material in the presence of air to form a humus-like material. Controlled methods of composting include mechanical mixing and aerating, ventilating the materials by dropping them through a vertical series of aerated chambers, or placing the compost in piles out in the open air and mixing it or turning it periodically.\r\n(Source: LEE)', 'composting', 0, 0, 0),
(702, 702, 'Reduction in the volume of a substance due to pressure.\r\n(Source: MGH)', 'compression', 0, 0, 0),
(703, 703, 'A mechanical device a) to provide the desired pressure for chemical and physical reactions, b) to control boiling points of fluids, as in gas separation, refrigeration, and evaporation, c) to evacuate enclosed volumes, d) to transport gases or vapors, e) to store compressible fluids as gases or liquids under pressure and assist in recovering them from storage or tank cars, and f) to convert mechanical energy to fluid energy for operating instruments, air agitation, fluidization, solid transport, blowcases, air tools, and motors.\r\n(Source: LEE)', 'compressor', 0, 0, 0),
(705, 705, 'The collective body that resulted in 1967 from the merger of the administrative networks of the European Atomic Energy Community (EURATOM), the European Coal and Steel Community (ECSC), and the European Economic Community (EEC). The singular term has also been widely used.\n(Source: ABDN)', 'European Communities', 0, 0, 0),
(706, 706, 'In solutions, the mass, volume, or number of moles of solute present in proportion to the amount of solvent or total solution.\n(Source: MGH)', 'concentration', 0, 0, 0),
(707, 707, 'The process of increasing the quantity of a component in a solution. The opposite of dilution.\n(Source: CED)', 'concentration', 0, 0, 0),
(708, 708, 'A mixture of aggregate, water, and a binder, usually Portland cement; it hardens to stonelike condition when dry.\n(Source: MGH)', 'concrete', 0, 0, 0),
(918219, 918219, 'A radio or television show in which a host interviews or chats with guests.', 'chat show, talk show', 0, 0, 0),
(710, 710, 'Transformation from a gas to a liquid.\r\n(Source: MGH)', 'condensation (process), condensation', 0, 0, 0),
(711, 711, 'The ratio of the electric current density to the electric field in a material. Also known as electrical conductivity.\r\n(Source: MGH)', 'conductivity, electrical conductivity', 0, 0, 0),
(714, 714, 'Clash between public interest and the private pecuniary interest of the individual concerned. A situation in which regard for one duty tends to lead to disregard of another.\r\n(Source: BLACK)', 'conflict of interests, conflict of interest', 0, 0, 0),
(715, 715, 'A formal meeting, often consisting of representatives of various organizations, that is assembled to promote, discuss or make arrangements regarding a particular subject or some matter of common interest.\r\n(Source: RHW)', 'congress', 0, 0, 0),
(716, 716, 'An order of conebearing plants which includes nearly all the present day Gymnospermae. Most are tall evergreen trees with needle-like (e.g., pines), linear (e.g. firs) or scale-like (e.g., cedars) leaves. They are characteristic of temperate zones and the main forest trees of colder regions. They provide timber, resins, tars, turpentine and pulp for paper.\n(Source: ALL)', 'conifer', 0, 0, 0),
(718, 718, '<Definition needed.>', 'conservation', 0, 0, 0),
(393932, 393932, 'A tree producing the pear fruit.', 'pear tree, pear', 0, 0, 0),
(729, 729, 'Any meeting or inquiry of concerned persons or advisors for the purpose of deliberation, discussion or decision on some matter or action.\r\n(Source: BLD)', 'consultation', 0, 0, 0),
(731, 731, 'Manufactured products intended primarily for personal use by individuals or families and classified as either durables or non-durables, depending on length of use.\r\n(Source: ODE / Greenwald)', 'consumer goods', 0, 0, 0),
(1180368, 1180368, 'A large bowl-shaped pot used for boiling over an open flame.', 'cauldron, caldron', 0, 0, 0),
(736, 736, 'Spending for survival or enjoyment in contrast to providing for future use or production.\r\n(Source: ODE)', 'consumption', 0, 0, 0),
(738, 738, 'A large case that can be transported by truck and than easily loaded on a ship.\n(Source: PHC)', 'container', 0, 0, 0),
(739, 739, 'The reinforced steel or concrete vessel that encloses a nuclear reactor. It is designed to withstand minor explosions in the core, to keep radionuclides from escaping into the environment, and to be safe against terrorist attack.\n(Source: WRIGHT)', 'containment, containment (nuclear industry)', 0, 0, 0),
(741, 741, 'Introduction into or onto water, air, soil or other media of microorganisms, chemicals, toxic substances, wastes, wastewater or other pollutants in a concentration that makes the medium unfit for its next intended use.\r\n(Source: TOE)', 'pollution, contamination', 0, 0, 0),
(742, 742, 'The gently sloping seabed of the shallow water nearest to a continent, covering about 45 miles from the shore and deepening over the sloping sea floor to an average depth of 400 ft. It continues until it reaches the continental slope. The continental shelf contains most of the important fishing grounds and a range of resources, including gas and oil, sand and gravel. However, the shelf is, in general, a structural extension of the continent, and so may also be a source of minerals found in that region, such as tin, gold and platinum.\n(Source: WRIGHT)', 'continental shelf', 0, 0, 0),
(745, 745, 'An agreement between two or more persons which creates an obligation to do or not to do a particular thing. Its essential are competent parties, subject matter, a legal consideration, mutuality of agreement, and mutuality of obligation.\n(Source: WESTS)', 'contract', 0, 0, 0),
(918243, 918243, 'Purposeless or foolish talk.', 'chatter', 0, 0, 0),
(751, 751, '1) A large densely populated urban sprawl formed by the growth and coalescence of individual towns or cities.\r\n2) Large area covered with buildings (houses or factories or public building, etc.)\r\n3) A large area occupied by urban development, which may contain isolated rural areas, and formed by the merging together of expanding towns that formerly were separate.\r\n(Source: CED /  PHC /  ALL)', 'conurbation', 0, 0, 0),
(752, 752, 'International agreement on a specific topic.\n(Source: RRDA)', 'convention', 0, 0, 0),
(754, 754, 'Setting aside a highly radioactive material until the radioactivity has diminished to a desired level.\r\n(Source: MGH)', 'cooling', 0, 0, 0),
(756, 756, 'A device that aids in heat removal from water used as a coolant in electric power generating plants.\n(Source: LANDY)', 'cooling tower', 0, 0, 0),
(758, 758, 'Work with an another person or in a team.', 'co-operation, cooperation', 0, 0, 0),
(761, 761, 'A chemical element; one of the most important nonferrous metals; a ductile and malleable metal found in various ores and used in industry, engineering, and the arts in both pure and alloyed form.\r\n(Source: MGH)', 'copper', 0, 0, 0),
(762, 762, 'A growth of small trees that are repeatedly cut down at short intervals; the new shoots are produced by the old stumps.\r\n(Source: MGH)', 'coppice', 0, 0, 0),
(763, 763, 'The skeleton of certain solitary and colonial anthozoan coelenterates; composed chiefly of calcium carbonate.\r\n(Source: MGH)', 'coral', 0, 0, 0),
(918261, 918261, 'An extremely talkative person.', 'chatterbox', 0, 0, 0),
(764, 764, 'Coral reefs have been built up from the skeletons of reef-building coral a small primitive marine animal, and other marine animals and algae over thousands of years. They occur in clear, shallow and sunlit seas. Coral reefs are one of the most productive and diverse ecosystems and are estimated to yield about 12% of the world^s fish catch. They are very vulnerable to any change in their environment, especially pollution, because it makes the water opaque. They must have light in order that photosyntesis by the algae can take place. Like trees, corals reflect the environmental conditions in which they grow, indicating marine pollution, sea-surface temperature and other aquatic conditions.\r\n(Source: WRIGHT)', 'coral reef', 0, 0, 0),
(765, 765, 'The highest phylum in the animal kingdom, characterized by a notochord, nerve cord, and gill slits; includes the urochordate, lancelets and vertebrates.\r\n(Source: MGH)', 'chordate', 0, 0, 0),
(766, 766, 'An accidental overheating of the part of the nuclear reactor where fission takes place, causing fuel elements and other parts of the reactor to melt, potentially leading to catastrophic consequences in which dangerous levels of radioactive materials would be released into the environment.\r\n(Source: FFD)', 'meltdown, nuclear meltdown, core meltdown', 0, 0, 0),
(767, 767, 'The thick light porous outer bark of the cork oak, used widely as an insulator and for stoppers for bottles, casks, etc.\r\n(Source: CED)', 'cork', 0, 0, 0),
(768, 768, 'A physical linkage, connecting two areas of habitat and differing from the habitat on either side. Corridors are used by organisms to move around without having to leave the preferred habitat.\n(Source: DUNSTE)', 'corridor', 0, 0, 0),
(769, 769, 'A process in which a solid, especially a metal, is eaten away and changed by a chemical action.\r\n(Source: CED)', 'corrosion', 0, 0, 0),
(1311510, 1311510, 'Vegetable oil that is extracted from the pulp of the oil palm.', 'palm oil', 0, 0, 0),
(772, 772, 'Radiations consisting of atomic nuclei, especially protons, of very high energy that reach the earth from outer space. Some cosmic radiations are very energetic and are able to penetrate a mile or more into the Earth.\n(Source: CED /  WRIGHT)', 'cosmic radiation', 0, 0, 0),
(774, 774, 'The attempt to assess, compare and frequently justify the total price or loss represented by a certain activity or expenditure with the advantage or service it provides.\r\n(Source: ODE)', 'cost-benefit analysis', 0, 0, 0),
(775, 775, 'The augmentation or rise in the amount of money incurred or asked for in the exchange of goods and services.\r\n(Source: ISEP /  EFP)', 'cost increase', 0, 0, 0),
(778, 778, 'In economics, the value of the factors of production used by a firm in producing or distributing goods and services or engaging in both activities.\r\n(Source: GREENW)', 'cost', 0, 0, 0),
(781, 781, 'The most economical natural fiber, obtained from plants of the genus Gossypium, used in making fabrics, cordage, and padding and for producing artificial fibers and cellulose.\r\n(Source: MGH)', 'cotton', 0, 0, 0),
(525061, 525061, 'Having lived for a relatively long period of time.', 'old, aged, long in the tooth', 0, 0, 0),
(782, 782, 'An area comprising more than one city and whose boundaries have been designed according to some biological, political, administrative, economic, demographic criteria.\r\n(Source: LANDYa)', 'county', 0, 0, 0),
(783, 783, 'A tribunal having jurisdiction of appeal and review, including the ability to overturn decisions of lower courts or courts of first instance.\r\n(Source: BLD)', 'court of justice', 0, 0, 0),
(784, 784, '<Definition needed.>', 'covering, roofing', 0, 0, 0),
(785, 785, 'An occupation or trade requiring manual dexterity or skilled artistry.\r\n(Source: AMHER)', 'arts and crafts, craft', 0, 0, 0),
(787, 787, 'A violation of the law, punishable by the State in criminal proceedings.\r\n(Source: WEBSTEa)', 'criminality', 0, 0, 0),
(788, 788, 'That body of the law that deals with conduct considered so harmful to society as a whole that it is prohibited by statute, prosecuted and punished by the government.\r\n(Source: DUHA)', 'criminal law', 0, 0, 0),
(525086, 525086, 'Having existed for a relatively long period of time.', 'old', 0, 0, 0),
(1180424, 1180424, 'Effusively or insincerely emotional.', 'mushy, kitschy, bathetic, schmalzy, soupy, drippy, sentimental, mawkish, maudlin, slushy', 0, 0, 0),
(791, 791, 'Any large tropical reptile of the family Crocodylidae: order Crocodylia. They have a broad head, tapering snout, massive jaws, and a thick outer covering of bony plates.\r\n(Source: CED)', 'crocodile', 0, 0, 0);
INSERT INTO `omega` (`id`, `real_id`, `definition`, `words`, `no_answer_vote`, `total_vote`, `answer_cid`) VALUES
(1180421, 1180421, 'Given to or marked by sentiment or sentimentality.', 'sentimental', 0, 0, 0),
(797, 797, 'A comparatively volatile liquid bitumen composed principally of hydrocarbon, with traces of sulphur, nitrogen or oxygen compounds; can be removed from the earth in a liquid state.\r\n(Source: MGH)', 'crude oil', 0, 0, 0),
(1442571, 1442571, 'A large pelagic shark inhabiting tropical and warm temperate seas, having long, white-tipped, rounded fins.', 'oceanic whitetip shark', 0, 0, 0),
(798, 798, 'Travelling by sea in a liner for pleasure, usually calling at a number of ports.\r\n(Source: CED)', 'cruising, cruise', 0, 0, 0),
(799, 799, 'A class of arthropod animals having jointed feet and mandibles, two pairs of antennae, and segmented, chitin-encased bodies.\r\n(Source: MGH)', 'crustacean', 0, 0, 0),
(800, 800, 'A large group of plants, comprising the Thallophyta, Bryophyta and Pteridophyta, the last of which are cryptogams.\r\n(Source: ALL)', 'cryptogam', 0, 0, 0),
(801, 801, 'The formation of crystalline substances from solutions or melts.\r\n(Source: MGH)', 'crystallisation', 0, 0, 0),
(802, 802, 'The branch of science that deals with the geometric description of crystals and their internal arrangement.\r\n(Source: MGH)', 'crystallography', 0, 0, 0),
(803, 803, 'Plants specially bred or improved by cultivation.\r\n(Source: CED)', 'cultivated plant', 0, 0, 0),
(804, 804, 'The practice of growing and nurturing plants outside of their wild habitat (i.e., in gardens, nurseries, arboreta).\r\n(Source: DUNSTE)', 'tillage, cultivation', 0, 0, 0),
(811, 811, 'The body of customary beliefs, social forms, and material traits constituting a distinct complex of tradition of a racial or social group.\n(Source: WEBSTE)', 'culture', 0, 0, 0),
(812, 812, 'The aggregate of courses of study provided in a particular school, college, university, adult education program, technical institution or some other educational program.\r\n(Source: RHW)', 'curriculum', 0, 0, 0),
(814, 814, 'Duties charged upon commodities on their importation into, or exportation out of, a country.', 'customs', 0, 0, 0),
(815, 815, 'The act or process of felling or uprooting standing trees, in order to produce timber products.', 'cutting, logging', 0, 0, 0),
(817, 817, 'Any of a group of compounds containing the CN group and derived from hydrogen cyanide, HCN.\r\n(Source: MGH)', 'cyanide', 0, 0, 0),
(818, 818, 'A storm characterized by the converging and rising giratory movement of the wind around a zone of low pressure (the eye) towards which it is violently pulled from a zone of high pressure. Its circulation is counterclockwise round the center in the northern hemisphere, clockwise in the southern hemisphere.\n(Source: GUNN)', 'cyclone', 0, 0, 0),
(819, 819, 'A branch of the biological sciences which deals with the structure, behaviour, growth, and reproduction of cells and the functions and chemistry of cell components.\r\n(Source: MGH)', 'cytology, cell biology', 0, 0, 0),
(820, 820, 'The degree to which an agent possesses a specific destructive action on certain cells or the possession of such action; used particularly in referring to the lysis of cells by immune phenomena and to antineoplastic drugs that selectively kill dividing cells.', 'cytotoxicity', 0, 0, 0),
(821, 821, 'A commercial establishment for processing or selling milk and milk products.\n(Source: AMHER)', 'dairy farm', 0, 0, 0),
